package com.nhnacademy.springmvc.controller;

import com.nhnacademy.springmvc.domain.Answer;
import com.nhnacademy.springmvc.domain.Post;
import com.nhnacademy.springmvc.domain.PostType;
import com.nhnacademy.springmvc.exception.InvalidPostAccessException;
import com.nhnacademy.springmvc.exception.ValidationFailedException;
import com.nhnacademy.springmvc.repository.AnswerRepository;
import com.nhnacademy.springmvc.repository.PostRepository;
import com.nhnacademy.springmvc.validator.PostValidator;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import org.junit.jupiter.api.Test;
import org.junit.jupiter.params.ParameterizedTest;
import org.junit.jupiter.params.provider.Arguments;
import org.junit.jupiter.params.provider.MethodSource;
import org.springframework.mock.web.MockMultipartFile;
import org.springframework.test.web.servlet.MockMvc;
import org.springframework.test.web.servlet.MvcResult;
import org.springframework.test.web.servlet.setup.MockMvcBuilders;
import org.springframework.web.servlet.ModelAndView;
import org.springframework.web.util.NestedServletException;

import java.util.ArrayList;
import java.util.List;
import java.util.Optional;
import java.util.stream.Stream;

import static org.assertj.core.api.Assertions.assertThat;
import static org.assertj.core.api.Assertions.catchThrowable;
import static org.mockito.ArgumentMatchers.anyString;
import static org.mockito.Mockito.*;
import static org.springframework.test.web.servlet.request.MockMvcRequestBuilders.*;
import static org.springframework.test.web.servlet.result.MockMvcResultMatchers.*;

class CustomerControllerTest {
    MockMvc mockMvc;

    PostRepository postRepository;
    AnswerRepository answerRepository;

    PostValidator validator;

    @BeforeEach
    void setUp() {
        postRepository = mock(PostRepository.class);
        answerRepository = mock(AnswerRepository.class);

        validator = new PostValidator();

        mockMvc = MockMvcBuilders.standaloneSetup(new CustomerController(postRepository, answerRepository, validator)).build();
    }

    @Test
    @DisplayName("문의 목록 보이기 성공")
    void showInquiryLists_success() throws Exception {
        List<Post> postList = new ArrayList<>();

        when(postRepository.getPostsByWriter(anyString())).thenReturn(postList);

        MvcResult result = mockMvc.perform(get("/customer/list")
                        .sessionAttr("sessionId", "user@1"))
                .andExpect(status().isOk())
                .andExpect(view().name("customer/inquiryList"))
                .andReturn();

        assertThat(result.getModelAndView().getModel().get("posts")).isEqualTo(postList);

        verify(postRepository, times(1)).getPostsByWriter(anyString());
    }

    @Test
    @DisplayName("특정 문의 게시글 보이기 실패 - 없는 게시글")
    void showInquiryDetailView_failByInvalidPostId_thenThrowInvalidPostAccessException() throws Exception {
        long postId = 100;

        when(postRepository.exists(postId)).thenReturn(false);

        Throwable th = catchThrowable(() ->
                mockMvc.perform(get("/customer/list/{postId}", postId)));

        assertThat(th).isInstanceOf(NestedServletException.class)
                .hasCauseInstanceOf(InvalidPostAccessException.class);
    }

    @Test
    @DisplayName("특정 문의 게시글 보이기 성공")
    void showInquiryDetailView_success() throws Exception {
        long postId = 1;
        Post post = new Post(postId, "", PostType.OTHERS, "", "", null, "");

        when(postRepository.exists(postId)).thenReturn(true);
        when(postRepository.getPost(postId)).thenReturn(post);

        MvcResult result = mockMvc.perform(get("/customer/list/{postId}", postId))
                .andExpect(status().isOk())
                .andExpect(view().name("customer/inquiryView"))
                .andReturn();

        Optional<Post> resultPost = Optional.ofNullable(result.getModelAndView())
                .map(ModelAndView::getModel)
                .map(m -> m.get("post"))
                .map(Post.class::cast);

        assertThat(resultPost).isPresent();
        assertThat(resultPost.get().getId()).isEqualTo(postId);

        verify(postRepository, times(1)).exists(anyLong());
        verify(postRepository, times(1)).getPost(anyLong());
    }

    @Test
    @DisplayName("특정 문의 게시글 보이기 성공 - 답변이 있는 경우")
    void showInquiryDetailView_success_withAnswer() throws Exception {
        long postId = 1;
        long answerId = 1;

        Answer answer = new Answer(answerId, "", "", "");
        Post post = new Post(postId, "", PostType.OTHERS, "", "", null, "");
        post.setAnswerId(answerId);

        when(postRepository.exists(postId)).thenReturn(true);
        when(postRepository.getPost(postId)).thenReturn(post);
        when(answerRepository.getAnswer(answerId)).thenReturn(answer);

        MvcResult result = mockMvc.perform(get("/customer/list/{postId}", postId))
                .andExpect(status().isOk())
                .andExpect(view().name("customer/inquiryView"))
                .andReturn();

        Optional<Post> resultPost = Optional.ofNullable(result.getModelAndView())
                .map(ModelAndView::getModel)
                .map(m -> m.get("post"))
                .map(Post.class::cast);

        Optional<Answer> resultAnswer = Optional.ofNullable(result.getModelAndView())
                .map(ModelAndView::getModel)
                .map(m -> m.get("answer"))
                .map(Answer.class::cast);

        assertThat(resultPost).isPresent();
        assertThat(resultPost.get().getId()).isEqualTo(postId);

        assertThat(resultAnswer).isPresent();
        assertThat(resultAnswer.get().getId()).isEqualTo(answerId);

        verify(postRepository, times(1)).exists(anyLong());
        verify(postRepository, times(1)).getPost(anyLong());
        verify(answerRepository, times(1)).getAnswer(anyLong());
    }

    @Test
    @DisplayName("문의 게시글 작성폼 보이기 성공")
    void showInquiryForm_success() throws Exception {
        mockMvc.perform(get("/customer/inquiry"))
                .andExpect(status().isOk())
                .andExpect(view().name("customer/inquiryForm"));
    }

    @ParameterizedTest(name = "{2}")
    @MethodSource(value = "validationTestValue")
    @DisplayName("문의 게시글 작성 실패 - 폼 형식 오류")
    void registerInquiry_failByValidationFiled_thenThrowValidationFailedException(String title, String content, String displayName) throws Exception {
        Throwable th = catchThrowable(() -> mockMvc.perform(post("/customer/inquiry")
                .param("title", title)
                .param("content", content)));

        assertThat(th).isInstanceOf(NestedServletException.class)
                .hasCauseInstanceOf(ValidationFailedException.class);
    }

    @Test
    @DisplayName("문의 게시글 작성 성공")
    void registerInquiry_success() throws Exception {
        String title = "this is title";
        String content = "this is content";
        String postType = "COMPLAIN";
        String writer = "user@1";

        MockMultipartFile file = new MockMultipartFile("files", "sdf".getBytes());

        mockMvc.perform(multipart("/customer/inquiry")
                        .file(file)
                        .param("title", title)
                        .param("content", content)
                        .param("postType", postType)
                        .sessionAttr("sessionId", writer))
                .andExpect(status().is3xxRedirection())
                .andExpect(redirectedUrl("/customer/list"));
    }

    private static Stream<Arguments> validationTestValue() { // argument source method
        return Stream.of(
                Arguments.of("1", "", "제목 : 2자 미만인 경우"),
                Arguments.of("   ", "", "제목 : 2자 이상이지만 공백으로 이뤄진 경우"),
                Arguments.of("naz97rz7AhUKft4KHdxHBAkQ4dUDCBA0ahUKEwjHnaz97rz7AhUKft4KHdxHBAkQ4dUDCBA0ahUKEwjHnaz97rz7AhUKft4KHdxHBAkQ4dUDCBA0ahUKEwjHnaz97rz7AhUKft4KHdxHBAkQ4dUDCBA0ahUKEwjHnaz97rz7AhUKft4KHdxHBAkQ4dUDCBA0ahUfdsfsdf", "", "제목 : 200자를 초과한 경우"),
                Arguments.of("title", "", "내용 : 40000자를 초과한 경우")
        );
    }
}